            result = square(*args)
        elif function_name == 'cube':
            result = cube(*args)
        elif function_name == '':
            result = sum_of_squares(*args)
        return result
    with cf.ThreadPoolExecutor() as executor:
        results = list(executor.map(execute_task, tasks))
    return results
